import React from 'react';
import { motion } from 'framer-motion';
import TopPage from '../components/TopPage';
import Footer from '../components/Footer';
import { FaPaintBrush, FaCube, FaCode, FaLaptop } from 'react-icons/fa';
import './About.css';

function About() {
  // Define common animation variants for fade/slide in
  const fadeInUp = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <>
      <TopPage />
      <main className="about-main">
        {/* Animated Background overlay */}
        <div className="bg-animation" />

        {/* Introduction Section */}
        <motion.section
          className="about-intro"
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
          variants={fadeInUp}
        >
          <h2>About Me</h2>
          <p>
            I'm Pranav Chahal, a passionate creative professional with a strong background in 3D art, design, and technology.
            I merge design with innovation to create immersive digital experiences and push the boundaries of creativity.
          </p>
        </motion.section>

        {/* Achievements Section */}
        <motion.section
          className="achievements"
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
          transition={{ duration: 0.8, delay: 0.2 }}
          variants={fadeInUp}
        >
          <h3>Achievements</h3>
          <ul>
            <li>Winner of XYZ Award for Digital Art (2023)</li>
            <li>Featured in ABC Magazine for groundbreaking 3D design</li>
            <li>Exhibited work at DEF Gallery</li>
            {/* Add more achievements as desired */}
          </ul>
        </motion.section>

        {/* Startups / Projects Section */}
        <motion.section
          className="startups"
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
          transition={{ duration: 0.8, delay: 0.4 }}
          variants={fadeInUp}
        >
          <h3>Startups &amp; Projects</h3>
          <div className="startup-list">
            <div className="startup-item">
              <img src="/images/startup1-logo.png" alt="Startup One Logo" className="startup-logo" />
              <div className="startup-info">
                <h4>Startup One</h4>
                <p>A cutting-edge tech startup focusing on augmented reality experiences.</p>
                <a href="https://startupone.com" target="_blank" rel="noopener noreferrer">
                  Visit Website
                </a>
              </div>
            </div>
            <div className="startup-item">
              <img src="/images/startup2-logo.png" alt="Startup Two Logo" className="startup-logo" />
              <div className="startup-info">
                <h4>Startup Two</h4>
                <p>A creative agency blending design and technology to drive innovation.</p>
                <a href="https://startuptwo.com" target="_blank" rel="noopener noreferrer">
                  Visit Website
                </a>
              </div>
            </div>
            {/* Add more startup items as needed */}
          </div>
        </motion.section>

        {/* Skills Section */}
        <motion.section
          className="skills"
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
          transition={{ duration: 0.8, delay: 0.6 }}
          variants={fadeInUp}
        >
          <h3>Skills</h3>
          <div className="skills-list">
            <div className="skill-item">
              <FaPaintBrush size={40} color="#ff6347" />
              <span>Designing</span>
            </div>
            <div className="skill-item">
              <FaCube size={40} color="#00ffff" />
              <span>3D Designing</span>
            </div>
            <div className="skill-item">
              <FaCode size={40} color="#61dafb" />
              <span>Programming</span>
            </div>
            <div className="skill-item">
              <FaLaptop size={40} color="#f0db4f" />
              <span>Web Development</span>
            </div>
          </div>
        </motion.section>
      </main>
      <Footer />
    </>
  );
}

export default About;
